INSERT INTO `artikels` VALUES (2,'PWRI Pasirian Dorong Kebahagiaan Lansia sebagai Pilar Kesejahteraan Sosial','pwri-pasirian-dorong-kebahagiaan-lansia-sebagai-pilar-kesejahteraan-sosial','artikel/xAXmLYpaOruy5Pko2a3KIhm3QjmCy55efnE5Rhb3.jpg','PWRI Lumajang','Efendi','Anam','2025-07-16','Kebahagiaan adalah hak semua usia. Di tengah dunia yang kerap sibuk dengan urusan produktivitas dan pertumbuhan ekonomi, PWRI (Persatuan Wredatama Republik Indonesia) Kecamatan Pasirian, Kabupaten Lumajang, mengingatkan bangsa ini akan satu hal penting, bahwa lansia yang bahagia adalah aset sosial yang tak ternilai.\r\n\r\nDalam rangka agenda empat bulanan sekaligus menyambut Hari Ulang Tahun PWRI 2025, PWRI Pasirian menggelar kegiatan rekreasi penuh makna ke Kota Batu, Jawa Timur pada 15 Juli 2025 lalu.\r\n\r\nDengan tema sederhana namun kuat, “Dengan Rekreasi Bikin Happy,” kegiatan ini tak hanya menjadi ajang bersenang-senang, tapi juga momentum membangun narasi sosial tentang pentingnya memperhatikan kebahagiaan lansia.\r\n\r\n“Kebahagiaan mampu meningkatkan kualitas hidup lansia. Mereka menjadi lebih aktif, sehat secara fisik dan mental, serta lebih terlibat dalam kehidupan sosial,” ungkap Ketua PWRI Kecamatan Pasirian, Sutrisno dalam keterangannya, Rabu (16/7/2025).\r\n\r\nTak sekadar berwisata, rombongan PWRI juga mengunjungi Pondok Pesantren Ar-Rahma Putri, yang dikelola oleh salah satu putra anggota PWRI. Kunjungan ini menjadi simbol kuat bahwa lansia tetap memiliki peran strategis dalam membina nilai, menginspirasi generasi, dan merawat keberlanjutan tradisi luhur bangsa.\r\n\r\nSutrisno menyampaikan bahwa kegiatan ini bukan hanya agenda seremonial, tapi juga bagian dari tanggung jawab sosial untuk menjaga martabat lansia.\r\n\r\n“Kami ingin menunjukkan bahwa kebahagiaan lansia bukan fasilitas tambahan, tapi kebutuhan dasar yang harus disediakan oleh lingkungan dan negara,” ujarnya tegas.\r\n\r\nData menunjukkan bahwa Indonesia tengah menuju era masyarakat menua (aging population), dengan persentase lansia yang terus meningkat setiap tahun. Jika tidak diimbangi dengan kebijakan dan budaya yang mendukung, kelompok lansia rentan mengalami kesepian, penurunan kesehatan mental, hingga depresi.\r\n\r\nApa yang dilakukan oleh PWRI Pasirian adalah contoh nyata dari community based initiative, gerakan dari bawah yang bisa menjangkau sisi-sisi kemanusiaan yang kerap luput dari kebijakan makro.\r\n\r\nKegiatan seperti ini menjadi ruang aman bagi para lansia untuk kembali merasa dihargai, didengar, dan dicintai. Mereka bukan sekadar pensiunan. Mereka adalah penjaga nilai, jembatan generasi, dan sumber inspirasi hidup.\r\n\r\n“Dengan memahami pentingnya kebahagiaan lansia, kita sedang merawat nilai kemanusiaan paling mendasar dalam masyarakat saling peduli,” pungkasnya. (MC Kab. Lumajang/Efendi/An-m)','Ekonomi & Sosial','2025-07-16 23:16:18','2025-07-24 18:40:16',33),(3,'Lumajang Perkuat Ketahanan Peternakan Lewat Vaksinasi PMK Gratis di Tingkat Desa','lumajang-perkuat-ketahanan-peternakan-lewat-vaksinasi-pmk-gratis-di-tingkat-desa','artikel/7OJ1SxFIqyD9ipvKMBNStkjaTlwvNHNh443KwewU.jpg','Kominfo Lumajang/Ardi','Ardi','Anam','0005-07-16','Pemerintah Kabupaten Lumajang, Jawa Timur, terus memperkuat ketahanan sektor peternakan dengan memberikan layanan vaksinasi Penyakit Mulut dan Kuku (PMK) secara gratis kepada hewan ternak. Program ini merupakan bagian dari inovasi pelayanan publik Sehari Ngantor di Kecamatan Terpadu (Setor Madu), yang kali ini dilaksanakan di Desa Duren, Kecamatan Klakah, Rabu (16/7/2025).\r\n\r\nBupati Lumajang, Indah Amperawati (Bunda Indah), menegaskan bahwa langkah ini merupakan bentuk kehadiran pemerintah dalam melindungi peternak dari ancaman ekonomi akibat wabah PMK, sekaligus menjamin keamanan pasokan pangan hewani di daerah.\r\n\r\n“Dengan vaksinasi ini, kita harapkan peternak Lumajang bisa lebih tenang dan produktif dalam mengembangkan usaha ternaknya. Kesehatan hewan adalah fondasi dari ketahanan pangan dan kesejahteraan ekonomi masyarakat,” ujar Bunda Indah saat meninjau langsung pelaksanaan vaksinasi.\r\n\r\nLayanan yang diberikan bukan hanya sebatas vaksinasi PMK. Pemerintah juga menyiapkan rangkaian perawatan tambahan, seperti penyuntikan vitamin, pemberian mineral dan obat cacing, serta penyemprotan disinfektan untuk menjaga sanitasi lingkungan kandang. Pendekatan menyeluruh ini dirancang agar daya tahan tubuh hewan ternak meningkat dan risiko infeksi dapat ditekan secara signifikan.\r\n\r\nLangkah preventif ini mendapat sambutan hangat dari masyarakat peternak. Bunali, seorang peternak dari Desa Duren, mengungkapkan rasa syukurnya atas perhatian pemerintah.\r\n\r\n“Kami sangat berterima kasih. Vaksinasi gratis ini sangat membantu kami menjaga hewan tetap sehat, apalagi untuk peternak kecil seperti kami, ini sangat berarti,” ujarnya.\r\n\r\nBunda Indah dalam kesempatan tersebut juga mengajak masyarakat, khususnya para peternak, untuk ikut aktif dalam menjaga kesehatan lingkungan peternakan dan melaporkan gejala-gejala mencurigakan secara cepat.\r\n\r\nMenurutnya, pengendalian PMK harus dilakukan secara kolaboratif antara pemerintah, tenaga medis hewan, dan komunitas peternak.\r\n\r\n“Kita ingin Lumajang bukan hanya bebas PMK, tetapi juga jadi wilayah yang tangguh secara peternakan. Dengan kerja sama yang baik, kesejahteraan peternak bisa kita tingkatkan bersama,” tegasnya.\r\n\r\nKepala Dinas Ketahanan Pangan dan Pertanian Kabupaten Lumajang Retno Wulan Andari, menambahkan bahwa program vaksinasi PMK akan terus dilanjutkan secara berkala ke desa-desa lain. Prioritas diberikan pada daerah dengan populasi sapi tinggi dan potensi lalu lintas ternak yang padat.\r\n\r\nMelalui program ini, Lumajang tidak hanya menjaga kesehatan hewan ternak, tetapi juga membangun sistem peternakan yang berdaya saing, adaptif terhadap krisis kesehatan hewan, dan inklusif bagi peternak kecil. Strategi ini diharapkan menjadi referensi nasional dalam tata kelola peternakan berbasis pelayanan langsung ke desa. (MC Kab. Lumajang/Ard/An-m)','Pertanian','2025-07-16 23:24:38','2025-07-24 17:31:27',24),(4,'Koperasi Diperkenalkan Lewat Aktivitas Publik di Alun-Alun Lumajang','koperasi-diperkenalkan-lewat-aktivitas-publik-di-alun-alun-lumajang','artikel/HR9OaVhElgDpfMQY47Zif5Q8hbeQ1W2qjoKm2XIi.jpg','Anam','Anam','Anam','2025-07-20','Pemerintah Kabupaten Lumajang memanfaatkan momentum Hari Koperasi Nasional (Harkopnas) ke-78 untuk menguatkan kembali pemahaman masyarakat tentang peran koperasi. Melalui kegiatan senam dan jalan sehat yang diikuti masyarakat umum di Alun-Alun Lumajang, Minggu (20/7/2025), koperasi diperkenalkan secara lebih dekat dan ringan kepada warga.\r\n\r\nKegiatan ini menjadi bagian dari upaya sosialisasi koperasi agar lebih dikenal dan dipahami sebagai sarana ekonomi kerakyatan yang relevan dalam kehidupan sehari-hari.\r\n\r\nBupati Lumajang Indah Amperawati (Bunda Indah), yang hadir langsung dalam kegiatan tersebut, menegaskan bahwa koperasi harus hadir tidak hanya dalam tataran kebijakan, tetapi juga dalam ruang-ruang publik yang akrab dengan masyarakat.\r\n\r\n“Melalui kegiatan sederhana seperti ini, kami ingin membangun kesadaran kolektif bahwa koperasi adalah bagian dari solusi ekonomi masyarakat. Pendekatannya harus menyenangkan dan dekat dengan kehidupan warga,” ungkapnya.\r\n\r\nKegiatan juga dihadiri Wakil Bupati Yudha Adji Kusuma bersama istri, Sekretaris Daerah dan istri, serta jajaran Forkopimda Lumajang. Hadirnya unsur pimpinan daerah menunjukkan dukungan bersama terhadap penguatan koperasi sebagai lembaga ekonomi berbasis kebersamaan.\r\n\r\nDi sepanjang jalur jalan sehat, masyarakat disuguhi berbagai stan koperasi dan pelaku UMKM binaan koperasi. Mereka menampilkan produk unggulan lokal serta informasi keanggotaan dan layanan koperasi. Ini menjadi ajang mengenalkan koperasi secara praktis dan aplikatif.\r\n\r\nWakil Bupati Yudha menyampaikan pentingnya konsistensi dalam mendekatkan koperasi kepada masyarakat. “Koperasi harus dikenalkan dengan cara yang lebih terbuka. Ini bukan lagi soal edukasi formal, tapi bagaimana menjadikan koperasi bagian dari aktivitas masyarakat,” ujarnya.\r\n\r\nTema nasional Harkopnas ke-78 tahun ini adalah “Koperasi Maju, Indonesia Adil dan Makmur”, yang menjadi pengingat penting bahwa koperasi masih dan tetap menjadi pilar ekonomi yang mampu menjangkau akar masyarakat.\r\n\r\nMelalui pendekatan partisipatif seperti ini, Pemkab Lumajang berharap semakin banyak warga yang terlibat langsung dalam gerakan koperasi, baik sebagai anggota maupun pelaku usaha berbasis kebersamaan. (MC kab. Lumajang/An-m)','Ekonomi & Sosial','2025-07-20 17:43:30','2025-07-26 19:34:25',31),(5,'Visioner dari Timur Jawa: Kepemimpinan AKBP Alex Sandy yang Menembus Sekat Birokrasi','visioner-dari-timur-jawa-kepemimpinan-akbp-alex-sandy-yang-menembus-sekat-birokrasi','artikel/yRBGuNmLHG9xspvzehj45518yHpU6XXdE97zCkOi.jpg','Humas Polres Lumajang','Anam','Anam','2025-07-20','Sosok inspiratif dalam kepemimpinan adalah suluh yang menuntun arah, terlebih di tengah dinamika zaman yang menuntut kecepatan, keberanian, dan empati. Di antara nama-nama yang muncul membawa harapan, nama AKBP Alex Sandy Siregar, S.I.K., S.H., M.H., hadir sebagai teladan yang lahir dari kerja nyata dan kepedulian.\r\n\r\nBertempat di Grand Empire Palace Surabaya, Sabtu (19/7/2025), AKBP Alex Sandy menerima penghargaan Indonesia’s Most Visionary Leader 2025, sebuah apresiasi bergengsi yang diberikan oleh Indonesia Award Magazine bekerja sama dengan Thanks Institute Indonesia.\r\n\r\nPenghargaan ini tidak sekadar simbol kehormatan, tetapi pengakuan atas semangat perubahan yang ia bawa dalam tubuh kepolisian, khususnya di Kabupaten Lumajang, Jawa Timur. Sebuah wilayah yang jauh dari sorotan ibukota, namun penuh geliat perubahan.\r\n\r\nMalam penghargaan itu menjadi panggung apresiasi bagi sosok-sosok yang tidak hanya memimpin, tetapi menginspirasi. Dalam kesempatan yang sama, hadir pula tokoh akademik nasional, Rektor UIN Sunan Ampel Surabaya, Prof. Muzakki, yang juga menerima penghargaan serupa.\r\n\r\nPenghargaan diserahkan langsung oleh General Manager IAM, Rajasa Pranadewa, bersama Ketua Panelis, Dr. Ketut A. Halimi. Penilaian dilakukan melalui proses seleksi panjang berbasis rekam jejak digital, capaian personal, dan dampak sosial dari gaya kepemimpinan yang dijalankan.\r\n\r\nAKBP Alex Sandy dikenal sebagai figur yang tidak hanya berorientasi pada ketertiban dan penegakan hukum, tetapi juga aktif mendorong transformasi pelayanan publik di institusinya. Ia memposisikan Polres bukan sekadar penjaga keamanan, melainkan pelayan masyarakat yang berkeadilan dan berbelas kasih.\r\n\r\n“Saya sangat berterima kasih kepada panelis dan keluarga besar Polres Lumajang. Penghargaan ini menjadi refleksi bersama bahwa kerja keras dan kerja tulus akan menemukan tempatnya,” ucap Alex Sandy dalam sambutannya.\r\n\r\nIa juga menegaskan bahwa prestasi ini adalah hasil gotong royong seluruh anggota Polres Lumajang. Menurutnya, membangun kepercayaan masyarakat terhadap institusi kepolisian adalah upaya kolektif, bukan individual.\r\n\r\nSelama menjabat, Alex Sandy telah menginisiasi sejumlah inovasi pelayanan berbasis digital, memperkuat program kemitraan dengan masyarakat, serta mendorong pendekatan preventif dalam penanganan potensi konflik sosial di Lumajang.\r\n\r\nSalah satu capaian pentingnya adalah penghargaan atas pengelolaan anggaran terbaik, di mana Polres Lumajang dinilai mampu mengelola dana publik secara transparan, efisien, dan tepat sasaran. Hal ini tidak hanya mencerminkan kepatuhan administratif, tetapi juga komitmen etis dalam tata kelola.\r\n\r\nMenurut Ketua Panelis, Dr. Ketut Abid Halimi, kepemimpinan visioner tidak lahir dari pencitraan, tetapi dari keteguhan nilai dan konsistensi aksi. Alex Sandy disebut berhasil membangun “ruang percaya” antara polisi dan publik, yang menjadi fondasi penting dalam demokrasi lokal.\r\n\r\n“Ia bukan hanya pemimpin birokrasi, tapi juga pemimpin sosial. Punya kepekaan terhadap kebutuhan warga, serta keberanian untuk mengubah yang sudah lama stagnan,” ujar Ketut.\r\n\r\nUcapan selamat juga datang dari Bupati Lumajang, Indah Amperawati (Bunda Indah), yang mengapresiasi pencapaian Kapolres Lumajang sebagai suatu kehormatan bagi daerah.\r\n\r\n“Saya bangga dan mengucapkan selamat kepada AKBP Alex Sandy atas penghargaan ini. Ini adalah pengakuan atas kepemimpinan beliau yang humanis dan progresif. Semoga ke depan, sinergi antara Pemkab dan Polres makin kuat, demi terwujudnya Lumajang yang aman, nyaman, dan sejahtera,” ujar Bunda Indah.\r\n\r\nLebih jauh, penghargaan ini diharapkan menjadi penyemangat bukan hanya bagi AKBP Alex Sandy secara personal, tetapi juga bagi seluruh jajaran kepolisian untuk terus berinovasi, melayani dengan hati, dan hadir sebagai pelindung rakyat.\r\n\r\nDalam dunia kepemimpinan yang sering kali kering akan keteladanan, tokoh-tokoh seperti Alex Sandy adalah bukti bahwa birokrasi bisa bernyawa, dan sistem bisa berjalan selaras dengan nilai-nilai kemanusiaan.\r\n\r\nKepemimpinan visioner, menurut IAM, tidak diukur dari banyaknya program yang dicanangkan, tetapi dari bagaimana program tersebut menyentuh, membangkitkan, dan mengubah hidup masyarakat secara nyata.\r\n\r\nBagi masyarakat Lumajang, kehadiran Alex Sandy menjadi penanda bahwa transformasi bukan hal yang mustahil. Ia membawa wajah baru institusi: lebih terbuka, lebih mendengar, dan lebih melayani.\r\n\r\nApresiasi nasional ini menjadi cermin bahwa pemimpin daerah juga bisa bersinar di panggung nasional, asalkan membawa dampak yang nyata dan dapat dirasakan langsung oleh rakyat.\r\n\r\nMelalui penghargaan ini, Indonesia seperti mengirim pesan kepada para pemimpin: bahwa yang dibutuhkan hari ini bukan sekadar jabatan dan prosedur, tapi nilai, keberanian, dan ketulusan.\r\n\r\nDan dari Lumajang, Jawa Timur, dengan langkah senyap namun berdampak besar AKBP Alex Sandy telah membuktikan bahwa perubahan bisa dimulai dari satu orang yang memilih untuk berbuat baik secara konsisten. (MC Kab. Lumajang/An-m)','Pemerintahan','2025-07-20 17:45:07','2025-07-24 17:30:45',27),(6,'Tak Hanya Mengenal Sekolah, Siswa Baru SMPN 2 Gucialit Dikenalkan Cinta Lingkungan','tak-hanya-mengenal-sekolah-siswa-baru-smpn-2-gucialit-dikenalkan-cinta-lingkungan','artikel/8QrnneejFzvukmWP1Xmi5xtPbYJddMlxtigJ1bAL.jpg','Dindik Lumajang','Yasin/Dindikbud Lumajang','Anam','2025-07-20','Di tengah gempuran modernisasi pendidikan, sebuah sekolah di pelosok Kabupaten Lumajang, Jawa Timur, justru menghadirkan oase pembelajaran yang membumi. SMP Negeri 2 Gucialit (SPENDAGU) menjadikan Masa Pengenalan Lingkungan Sekolah (MPLS) bukan sekadar rutinitas tahunan, melainkan panggung awal membentuk generasi yang peduli terhadap alam.\r\n\r\nLebih dari seratus siswa baru, Sabtu (19/7/2025), tidak disambut dengan ceramah atau baris-berbaris, tetapi langsung diajak menyentuh tanah, menanam harapan dalam bentuk bibit pohon, dan memunguti sampah di kawasan wisata Antrukan Pawon, ikon alam lokal yang kini menjadi laboratorium ekologi mini.\r\n\r\nBertajuk “SPENDAGU Peduli Lingkungan”, kegiatan ini dirancang untuk menanamkan nilai ekologis sejak langkah pertama siswa memasuki dunia sekolah menengah. Bukan sekadar teori di ruang kelas, melainkan aksi nyata yang menyatu dengan semilir angin, suara sungai, dan aroma tanah basah.\r\n\r\n“Kami ingin siswa tidak hanya tahu, tapi peduli dan bertindak. Alam adalah guru terbaik,” ungkap Kepala SMPN 2 Gucialit, Idam Djunaedi, penuh keyakinan.\r\n\r\nApa yang dilakukan sekolah ini bukan sekadar edukasi, tapi sebuah gerakan kecil yang memberi gema besar. Pemerintah desa, camat, tokoh masyarakat, Dinas Lingkungan Hidup, Dinas Pendidikan, hingga mahasiswa Kuliah Kerja Nyata (KKN) dari Universitas Brawijaya ikut terlibat aktif. Sebuah kolaborasi lintas sektor yang menjadi teladan bahwa menjaga bumi bukan tugas satu lembaga semata, tapi panggilan semua hati yang sadar.\r\n\r\nDalam MPLS tersebut, siswa dikenalkan dengan cara memilah sampah, memahami ancaman plastik sekali pakai, hingga menulis jurnal pohon yang mereka tanam sendiri. Metode experiential learning ini membuat proses belajar menjadi hidup dan membekas di benak.\r\n\r\n“Anak-anak jadi bertanya, kenapa harus menanam pohon? Kenapa plastik berbahaya? Pertanyaan-pertanyaan itu adalah tanda bahwa kesadaran mulai tumbuh,” ujar dia.\r\n\r\nDi tengah keprihatinan terhadap krisis iklim global, langkah kecil ini terasa berarti. Dari desa kecil bernama Gucialit, terbit secercah harapan bahwa masa depan lingkungan Indonesia bisa dijaga sejak dini, melalui pendidikan yang membumi dan menyentuh nurani.\r\n\r\nProgram ini juga mengangkat potensi wisata lokal, menjadikan Antrukan Pawon sebagai ruang belajar terbuka. Anak-anak belajar menghargai lingkungannya sendiri, sebelum melangkah lebih jauh mengenal dunia.\r\n\r\n“Kalau sejak kecil mereka sudah mencintai alam, maka mereka akan tumbuh jadi pemimpin yang tak tega merusaknya,” kata Camat Gucialit, Siswanto yang hadir mendampingi kegiatan tersebut.\r\n\r\nMPLS di SPENDAGU bukan hanya tentang adaptasi siswa baru, tapi tentang membentuk pemahaman mendalam: bahwa sekolah tak sekadar tempat belajar, tapi tempat menumbuhkan tanggung jawab sosial dan ekologis.\r\n\r\nGerakan ini juga membuktikan, bahwa pendidikan lingkungan tak harus mahal atau kompleks. Cukup dari satu sekolah kecil, satu desa yang sadar, dan satu pohon yang ditanam dengan cinta Indonesia bisa berubah.\r\n\r\nSebagaimana akar yang tumbuh diam-diam di bawah tanah, perubahan besar kerap dimulai dari tindakan-tindakan sunyi. Dari tangan kecil yang menanam, tumbuhlah harapan bagi bumi yang lebih lestari. (MC Kab. Lumajang/Dindik/Ysn/An-m)','Lingkungan Hidup','2025-07-20 17:46:24','2025-07-24 17:31:14',31),(7,'Menuju Tata Kelola Data Berkualitas, Lumajang Genjot Persiapan EPSS','menuju-tata-kelola-data-berkualitas-lumajang-genjot-persiapan-epss','artikel/eU2O3G1YyVM4vVmMe9VyAj0z6bDPOZAE2S5MtmA3.jpg','Kominfo Lumajang/Melani','Kominfo Lumajang/Melani','Anam','2025-07-20','Di tengah arus besar transformasi digital pemerintahan, data bukan lagi sekadar angka. Ia menjadi fondasi kebijakan, arah pembangunan, dan wajah transparansi publik. Untuk itu, Pemerintah Kabupaten Lumajang memperkuat langkah koordinatif dalam menghadapi Evaluasi Penyelenggaraan Statistik Sektoral (EPSS) Tahun 2025.\r\n\r\nUpaya tersebut diwujudkan lewat Rapat Koordinasi Pemenuhan Bukti Dukung EPSS domain kelembagaan, yang digelar pada Jumat (18/7/2025) lalu di Ruang Rapat Kreshna, Diskominfo Lumajang. Agenda strategis ini mempertemukan sejumlah pemangku kepentingan, mulai dari Badan Pusat Statistik (BPS) Kabupaten Lumajang, Bappeda, Dinas Pendidikan dan Kebudayaan (Dindikbud), hingga Dinas Ketahanan Pangan dan Pertanian.\r\n\r\nKepala Seksi Penyelenggaraan Statistik Dinas Komunikasi dan Informatika (Diskominfo) Kabupaten Lumajang, Layli Fajriah, menegaskan bahwa penguatan kelembagaan statistik sektoral tak bisa ditawar.\r\n\r\n“Koordinasi lintas perangkat daerah adalah keniscayaan. Tanpa itu, sulit memastikan standar penyelenggaraan statistik sektoral berjalan optimal. Forum ini jadi pondasi untuk menyamakan persepsi, merapikan bukti dukung, dan memperkuat akuntabilitas data,” ujar dia saat dikonfirmasi, Minggu (20/7/2025).\r\n\r\nEvaluasi Penyelenggaraan Statistik Sektoral sendiri merupakan instrumen nasional yang menilai sejauh mana tata kelola data sektoral di pemerintah daerah berjalan efektif dan sesuai pedoman Satu Data Indonesia. Domain kelembagaan menjadi salah satu indikator kunci dalam penilaian tersebut.\r\n\r\nMenurut Hosisa Tata Hasanah, Perencana Muda Bappeda Lumajang, pemenuhan bukti dukung tidak bisa dilakukan secara insidental. “Semua sudah tertuang dalam rencana aksi. Timeline-nya jelas dan harus dikawal ketat. Jika tidak, kita akan tertinggal dalam tahapan finalisasi dokumen nasional,” ungkapnya.\r\n\r\nDari sisi statistik, Roni Hartono selaku Pembina Data BPS Lumajang memberikan dukungan penuh. Ia menyatakan kesiapan BPS mendampingi perangkat daerah untuk memastikan sinkronisasi dokumen, baik dari segi kelengkapan maupun waktu rilis data publik. “Kita bicara bukan hanya soal kepatuhan administratif, tapi juga soal kepercayaan publik terhadap kualitas data pemerintah,” tegas Roni.\r\n\r\nDiskusi dalam rapat ini juga mengurai tantangan yang kerap muncul dalam pengumpulan bukti dukung, mulai dari ketidakterpaduan antar sistem informasi perangkat daerah hingga keterbatasan sumber daya pengelola data. Meski demikian, semua pihak sepakat untuk mendorong percepatan penyusunan dokumen dengan dukungan pendampingan teknis berkelanjutan.\r\n\r\nRapat koordinasi ini juga mencerminkan semakin kuatnya kesadaran pemerintah daerah terhadap pentingnya statistik sektoral dalam perumusan kebijakan publik. Pemerintah daerah dituntut tidak hanya menjadi pengguna data, tetapi juga produsen data yang kredibel dan akuntabel.\r\n\r\nDengan melibatkan multipihak dalam proses persiapan EPSS, Lumajang menunjukkan komitmen membangun tata kelola statistik yang berdaya saing. Langkah ini tak hanya penting untuk memperoleh penilaian baik secara nasional, tetapi juga untuk memastikan bahwa kebijakan yang diambil benar-benar berakar dari realitas faktual yang terukur.\r\n\r\nMenjelang penilaian akhir EPSS, Diskominfo bersama seluruh perangkat daerah diharapkan dapat menyelaraskan langkah dan mempercepat penyelesaian bukti dukung sesuai indikator yang ditetapkan. EPSS bukan semata evaluasi administratif, melainkan instrumen reflektif untuk menilai kesiapan pemerintah daerah dalam mengelola data sebagai basis pembangunan. (MC Kab. Lumajang/Mel/An-m)','Pemerintahan','2025-07-20 19:39:33','2025-07-27 06:24:13',47),(8,'Taman Sibejo, Simfoni Kecil dari Desa di Lumajang untuk Ekonomi Keluarga','taman-sibejo-simfoni-kecil-dari-desa-di-lumajang-untuk-ekonomi-keluarga','artikel/5HeA7gPmf6O5IsApf7HDDOfGcoLA3PpAgV4Pb9UO.jpg','Ferdian','Anam','Ferdian','2025-07-20','Sebuah langkah cerdas dan menyentuh hati ditunjukkan oleh Pemerintah Desa Sidorejo, Kecamatan Rowokangkung, Kabupaten Lumajang. Tak hanya memikirkan ruang bermain anak, mereka juga membangun denyut ekonomi lokal melalui taman multifungsi bernama Taman Sibejo. Tempat ini kini menjadi simbol kebangkitan ekonomi desa yang berpijak pada kebahagiaan anak-anak dan semangat pelaku UMKM.\r\n\r\nTaman Sibejo singkatan dari Sidorejo Berjaya bukan sekadar taman hiburan. Ia adalah ruang publik yang menjelma menjadi titik temu antara keceriaan masa kecil dan geliat usaha kecil yang menopang kehidupan keluarga. Konsep ini lahir dari kepedulian akan pentingnya ruang aman dan produktif, yang menyentuh berbagai lapisan masyarakat.\r\n\r\nMenanggapi inovasi ini, Ketua Tim Penggerak PKK Kabupaten Lumajang, Dewi Natalia Yudha Adji Kusuma, melakukan kunjungan langsung ke lokasi pada Sabtu malam (19/7/2025). Didampingi jajaran pengurus PKK kabupaten, Dewi Natalia menyampaikan apresiasi mendalam terhadap langkah progresif Desa Sidorejo.\r\n\r\n“Saya sungguh bangga. Di taman yang sederhana ini, saya melihat mimpi-mimpi besar masyarakat desa tumbuh: dari anak-anak yang bernyanyi di panggung kecil, hingga ibu-ibu yang menghidangkan cita rasa lokal melalui UMKM-nya,” tutur dia dengan penuh semangat.\r\n\r\nIa menekankan, UMKM adalah denyut nadi ekonomi kerakyatan. Dengan memberdayakan pelaku UMKM, desa tak hanya membuka peluang ekonomi, tapi juga memperluas ruang kerja, terutama bagi kaum perempuan dan generasi muda.\r\n\r\nLangkah Desa Sidorejo ini dinilai sebagai praktik baik yang selaras dengan semangat pemberdayaan ekonomi keluarga, sebagaimana menjadi fokus utama gerakan PKK. “Tempat seperti Taman Sibejo adalah bukti nyata bahwa pemberdayaan bisa dimulai dari titik yang sangat dekat dengan kehidupan sehari-hari,” ujar Dewi.\r\n\r\nTaman ini menjadi saksi bagaimana anak-anak dapat mengekspresikan bakatnya di panggung hiburan, sementara para pelaku UMKM mendapat akses pasar yang lebih luas tanpa harus meninggalkan desa. Kombinasi antara hiburan dan ekonomi ini dinilai mampu menciptakan ekosistem desa yang inklusif dan berdaya saing.\r\n\r\nSelain menikmati produk-produk lokal dari stan UMKM yang disediakan, masyarakat juga diajak untuk menyaksikan penampilan anak-anak desa yang menunjukkan kebolehannya di hadapan para tamu. Ada yang menyanyi, membaca puisi, hingga menari tradisional dengan kostum penuh warna.\r\n\r\nLebih dari itu, taman ini memberi ruang untuk mempererat kohesi sosial. Masyarakat saling mengenal, bergotong-royong, dan terlibat langsung dalam pengelolaan kegiatan ekonomi kreatif di taman. Ini bukan sekadar taman, ini ruang kolaborasi antargenerasi.\r\n\r\n“Ini momentum penting. Desa sudah memulai, dan tugas kita sekarang adalah menjaga, memperkuat, dan mengembangkan. Saya ajak semua elemen, termasuk swasta dan akademisi, untuk mendukung langkah-langkah seperti ini,” imbuh Dewi Natalia.\r\n\r\nSebagai Ketua TP-PKK, ia menyadari betapa pentingnya menciptakan lingkungan yang mendukung tumbuh kembang anak sekaligus memperkuat pondasi ekonomi rumah tangga. “Taman Sibejo adalah gambaran desa masa depan bahagia, produktif, dan saling mendukung,” katanya menutup sambutannya.\r\n\r\nInovasi ini mendapat sambutan positif dari masyarakat. Rina, pelaku UMKM yang menjajakan keripik pisang khas Sidorejo, mengaku omzetnya meningkat dua kali lipat setiap kali taman menggelar acara. “Biasanya jualan dari rumah, tapi sekarang banyak yang datang karena ada anak-anak tampil. Dagangan cepat habis,” ucapnya bahagia.\r\n\r\nTaman Sibejo menjadi bukti bahwa desa tidak selalu harus menunggu bantuan besar untuk membuat perubahan. Dengan kreativitas, partisipasi, dan visi ke depan, desa bisa menciptakan dampak yang riil bagi warganya.\r\n\r\nLangkah Desa Sidorejo ini pun menjadi inspirasi bagi desa-desa lain di Kabupaten Lumajang untuk membangun ruang yang inklusif, tempat di mana anak-anak tertawa, ibu-ibu berkreasi, dan ekonomi rakyat berdenyut bersama. (MC Kab. Lumajang/Ferdian/An-m)','Ekonomi & Sosial','2025-07-20 19:41:17','2025-07-27 22:06:13',66);
